data.text:
@Rschooley Choose a place that takes safety seriously.

I'm in San Miguel de Allende, MX, and they are NOT kidding around.

Temp checks, antibacterial lotion, masks required all over. Names/phone numbers taken at restaurants. Our vaccination cards were required by airport immigration.

